import Head from 'next/head';
import Navbar from './NavBar';
import { theme } from "@chakra-ui/core"

// Let's say you want to add custom colors
const customTheme = {
    ...theme,
    colors: {
        ...theme.colors,
        brand: {
            900: "#1a365d",
            800: "#153e75",
            700: "#2a69ac",
        },
    },
};


const Layout = (props) => (
    <ThemeProvider theme={customTheme}>
        <div className="bg-black">
            <Head>
                <title>SpaceX</title>
                <link href="https://fonts.googleapis.com/css2?family=Bebas+Neue&family=Poppins:wght@400;500;600;700;800;900&display=swap" rel="stylesheet"></link>
            </Head>
            <Navbar />
            {props.children}
        </div>
    </ThemeProvider>
);

export default Layout;
